import { all, takeLatest } from 'redux-saga/effects';

import { TodosTypes } from './../Todos/types';

import { load } from './../Todos/store/ducks/todos/sagas';

export default function* rootSaga() {
    return yield all([
        takeLatest(TodosTypes.LOAD_REQUEST, load)
    ]);
}
